import os
import shutil
from pathlib import Path
import utils


# Mock the BASE_STORAGE_PATH for local testing
TEST_STORAGE = Path("./test_data")
utils.BASE_STORAGE_PATH = TEST_STORAGE

def test_save_image():
    if TEST_STORAGE.exists():
        shutil.rmtree(TEST_STORAGE)
    
    # Test 1: Save a receipt
    content = ""
    path = utils.save_image("receipt_test2.png", content, "receipts")
    print(f"Saved receipt to: {path}")
    assert "receipts/receipt_test.png" in path
    assert os.path.exists(path)

    # Test 2: Save an invoice
    path = utils.save_image("invoice_test.png", content, "invoices")
    print(f"Saved invoice to: {path}")
    assert "invoices/invoice_test.png" in path
    assert os.path.exists(path)

    # Test 3: Save 'Other'
    path = utils.save_image("other_test.png", content, "something_else")
    print(f"Saved other to: {path}")
    assert "Other/other_test.png" in path
    assert os.path.exists(path)

    print("All saving logic tests passed!")

if __name__ == "__main__":
    test_save_image()
    # Cleanup
